import React from "react";
import Menu from "./Menu";
import Axios from 'axios';
const Home = () =>{
    return(
        <>
        <Menu />
        <h1>home page</h1>
        <select>
            <option value='1'>1</option>
            <option value='2'>2</option>
            <option value='3'>3</option>
        </select>

        </>
    )
}
export default Home;
